  CardTitle,
} from "reactstrap";

class DishDetail extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="col-12 col-md-5 m1">
        <Card>
          <CardImg></CardImg>
        </Card>
      </div>
    );
  }
}

export default DishDetail;
